 dont think this is a dealbreaker\nMuscular build, lean but not shredded\nAtheist\n27 years old, British\nNon-smoker, rarely drink but not teetotal\nFirst-class Chemistry degree\nVegan\n~50k salary, own a flat in Glasgow with a small mortgage\nHighly extraverted\nMain love language is physical touch, followed by quality time\n\nWork life\nIve decided against publishing this on the Internet. Feel free to enquire. \n\nCharacter traits\nDiscipline, drive, and executive function\nVery low in neuroticism and anxiety, with a stable mood (Ive got graphs lol)\nWhen Im sad, I solve this through reflection and talking about it; cheering me up isnt a thing\nRegrettably low in some kinds of curiosity\nDirect style of communication\nHard to offend\nAside from a few skeletal anomalies that havent meaningfully limited me, I have excellent health (as do most of my family)\nProbably too invested in some kind of general protagonist identity, and working on being warmer and more human\nI very much have cognitive empathy; I care about people/things, but dont feel their emotions with them.\nIm becoming more disagreeable and willing to challenge people as I age. Id like to believe I keep this constructive and make sure not to leave others feeling attacked. If your tortilla policy is mental, or I think a key part of your philosophy is wrong, youll hear about it. \n\nDaily routines\nI am more of a morning person; staying up late into the night without a good reason is not a thing for me\nI reach full alertness and energy exactly 20 minutes after getting up\nI rarely suffer from low energy and nap only infrequently\nThis is predicated on my daily rhythm giving me good sleep and nourishing food, I absolutely crash without these\nMy meals are very big, and I hardly snack. \nI abhor killing time at home and prefer to spend time intentionally. This most frequently comes up in relationships around partners wanting to spend lots of time watching TV/film. If you want me to do this, its best to sell me on why that show in particular is worth a deliberate decision to watch it. Just putting something on as a low-effort way to spend an evening will not fly. \nWork out 3 days on, 1 day off.\nEach night, I record what I did that day in a Memory Book and have every single day for 7 years. Be prepared to feature!\n\nRomance \u0026 the Bedroom\nPretty happy with vanilla stuff, but I have discovered a dominant side and would like to explore this more. \nIm not that kinky\nIm not sure I would have believed it if Id read this a few months ago, but Ive unlocked a part of my mind that experiences sex in ways very similar to women: erogenous zones and mind-splitting orgasms that last several seconds and arent related to ejaculation. \nHigh libido and I actively want near-daily sex, but my desire to go for multiple rounds can be greatly hampered by not having eaten enough or physical tiredness\nYoull generally get a lot more out of me by starting early in the evening, or earlier in the day, with a coffee\n*friends mocking me for going to the Roomba recharge station*\n\nIve had one relationship lasting a year, a handful of four-month relationships, and a fair number of short-term flings or one-off encounters. Im in touch and on good terms with many of these people, and dont hold grudges with any. None of these were bad breakups, and I have never fought with a romantic partner. My longest relationship was polyamorous for the second half. I feel we made this work, and it is something I could continue doing. That being said, it came with costs that at present I would prefer not to pay in a long-term relationship. If youre poly and otherwise think we could be a match, please dont rule it out on these grounds!\n"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_pw":595.4399999999999,"ds_lhs":1,"ds_ulhfl":false,"ds_hi":"kix.8vyp3ppkeh7k","ds_ph":841.68}},{"ty":"ae","et":"list","id":"kix.1wn11oy7f16","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":false,"ts_s elChunkLoadStart = new Date().getTime(); DOCS_initialLoadTiming.incrementTime('mp', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script nonce="vdh_R85qYR1PQYADVPiQDQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script nonce="vdh_R85qYR1PQYADVPiQDQ">DOCS_modelChunk = {"chunk":[{"ty":"is","ibi":4307,"s":"\nI like to take relationships quickly and am comfortable living together earlier than most, I think. As I grow close with people, I can become an absolute Snuggle Bear, but this is dependent on chemistry. A friend with benefits, who I cherish but do not feel this chemistry with, instead described me as a Roomba...\n\n\fShow, dont tell\n\nI host a lot of events for my friends. This one was a Dating Discussion Forum, to give people a platform to have a frank, open conversation about their experiences with dating. \n\nWarhammer is my main hobby. Painting the miniatures and playing the game with friends occupies the nerdy part of my mind most of the time. \n\nIve taken up the gauntlet to bag all of the Munros. Ive hiked barely a tenth of them so far. Appetite to go up a hill with me is appreciated!\n\nTheres a specific smile that comes out when I drink specialty coffee.\n\nIm a bit functional when I cook for myself, but I love putting effort into cooking for others!\n\n\n\nMy fitness is very important to me. I was the least fit child at my primary school, and through consistent effort since, have achieved a number of things I am truly proud of. On a bad day, I can do 6 muscle-ups. Earlier this year, I joined the 1000-pound club in powerlifting. Now that Ive leaned down again, Ill run a mile in comfortably under 7 minutes, and 100m in 16 seconds. \n\nI can do sin(x) functions in my head, and could teach you how \nMade Richard Dawkins laugh\nEstimated to eat 92.3kg of houmous per year\nExchanged typewritten letters with a romantic interest whose name I never knew through unsuspecting Berlin baristas\nYou\nBasic info\nThere are very few unequivocal green and red flags for me, and many different ways I can be attracted to a person. Most of my red flags are fairly common: jealous, controlling, unable to accept they are at fault, and boring. I list ones specific to me below.\nGreen flags/nice-to-haves:\nLarge breasts\nMuscular/athletic figure\nConfidence/assertiveness\nAged 20-33\nSelf-initiated passion projects, ideally nerdy ones\nClear and open communication styles \nOutdoorsy/not dependent on creature comforts\nMorally motivated, seeking to make the world better\nHas done really hard stuff\nHigh IQ and at least middling EQ\nRed flags:\nActively religious or superstitious\nNot vegan and unwilling to discuss my ethics on this with an open mind\nSignificant lack of interest in their health, fitness, and longevity\n\nWork life\nI want to date people who impress me, and a big part of that will usually come from their career goals. Ambition is helpful, but at a minimum, I want a partner to know who they are and what they are working towards. The minutiae of this are not so important to me, and there are very few professions that constitute red flags. Essentially, I want to be impressed by a womans grit. Tell me how hard youve worked and what you can overcome! \n\nFinances\nId like to think I am generous with friends and partners, and recognise that there are (dwindling) expectations on a man to spend money on a woman. That being said, I am far more excited to date someone who sees being a homeowner as a signal of good financial security and executive function than someone trying to marry rich. I intend to donate too much money for that to ever pay off. With that said, I dont have any expectations for a partners income or financial situation, provided that they can take care of themselves. \n\nThe Bedroom\nI would like for a partner to be of a similarly high sex drive and be committed to this remaining an exciting activity. Ideally, an empty field in the summer would be a perfectly acceptable opportunity to get it on. Eagerness to understand my weird tantric capabilities, and consensual power imbalance would be much appreciated! Theres not much more of a filter I want to apply here; the rest can be figured out with dating.\n\nIf you feel like we could be a match, feel free to reach out by email! "},{"ty":"is","ibi":8230,"s":"\u0003Email: tom.arrow42@gmail.com\n\n"},{"ty":"ae","et":"list","id":"kix.1ye3ccxywyjw","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":162.0,"b_gs":"","b_a":0,"b_sn":1,"b_gt":9,"b_il":180.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":126.0,"b_gs":"","b_a":0,"b_sn":1,"b_gt":9,"b_il":144.0},"nl_2":{"b_gf":"%2","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":90.0,"b_gs":"","b_a":0,"b_sn":1,"b_gt":9,"b_il":108.0},"nl_1":{"b_gf":"%1","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"t
